import React from "react";
import "./App.css";

class App extends React.Component {

  searchResult() {
    console.log("Search Result clicked..");
    //moviesList();
  }

  componentDidMount() {
    fetch("http://www.omdbapi.com/?i=tt3896198&apikey=6742d6e8")
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            items: result.items
          });
        },
        // Note: it's important to handle errors here
        // instead of a catch() block so that we don't swallow
        // exceptions from actual bugs in components.
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
  }

  render() {
    return (
      <div className={"App"}>
        <div className={"InputWrapper"}>
          <input placeholder={"Enter a value..."} />
          <button onClick={this.moviesList}>Submit</button>
        </div>
      </div>
    );
  }
}

export default App;
